webpackJsonp([0xbc7d63d1bec5],{1367:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/ultrashock-v2/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="http://www.ultrashock.com/" title="Open link in a new window">\n  <a\n    class="gatsby-resp-image-link"\n    href="/portfolio-2018/static/ultrashock-b4f152271c83fe4c3a1ce119c1292a5d-e8574.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ultrashock"\n        title=""\n        src="/portfolio-2018/static/ultrashock-b4f152271c83fe4c3a1ce119c1292a5d-e8574.jpg"\n        srcset="/portfolio-2018/static/ultrashock-b4f152271c83fe4c3a1ce119c1292a5d-c94d9.jpg 158w,\n/portfolio-2018/static/ultrashock-b4f152271c83fe4c3a1ce119c1292a5d-9885b.jpg 315w,\n/portfolio-2018/static/ultrashock-b4f152271c83fe4c3a1ce119c1292a5d-e8574.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </a></p>\n<p>Ultrashock is one of those sites whose forums I tend to stumble around quite frequently on the \'net - but I\'ve only recently taken a good look at it. The site itself is pretty impressive you know. It\'s mostly full browser flash, and a few of the interface elements gives away that it\'s based in Flex, presumably with some very custom UI elements.</p>\n<p>There\'s the whole <a href="http://www.asual.com/swfaddress/" title="Open link in a new window">SWFAddress</a> deeplinking going on, Flash and Flex integration, and a very seamless transition to non-Flash elements, like the Forums and Wordpress powered blog. If you\'re looking for a showcase Flex site, here\'s a goodie. <a href="http://www.thefwa.com/?app=winners&#x26;id=6489" title="Open link in a new window">FWA</a> thinks so too.</p>\n<p>What\'s more they\'re in the trade of selling content, kinda like FlashDen - which is cool.</p>',frontmatter:{title:"Ultrashock v2",date:"April 24, 2008",tags:["external-links","flash","flex","showcase"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/uploading-files-to-trello-with-node-js/",tags:["nodejs","trello"],title:"Uploading files to Trello with Node.js",image:null,date:"2017-05-18T20:38:43.000Z"}},next:{frontmatter:{path:"/blog/tweener-and-256-levels-of-recursion-were-exceeded-in-one-action-list/",tags:["actionscript"],title:'Tweener and "256 levels of recursion were exceeded in one action list"',image:null,date:"2008-10-13T08:30:52.000Z"}}}}}});
